import React, { Component } from 'react';
import Player from 'player';

class Table extends Component {
  state = {
      button: 1,
      callButtonText: "Call"
  }

  render() {
    return (
      <div className="table">
        <div className="players">

        </div>
        <div className="felt">
        </div>
        <div className="buttons">
          <button className="action-button action-fold">Fold</button>
          <button className="action-button action-call">{this.state.callButtonText}</button>
          <button className="action-button action-raise">Raise</button>
        </div>
      </div>
    );
  }
}

export default Table;
